import React from 'react';
import {Link} from 'react-router-dom';
import './navbar.styles.scss';
import {selectDirectorySections} from '../../redux/directory/directory.selectors';
import { connect } from 'react-redux';
const NavBar = props => (
    <nav>
        <div></div>
        <div className='nav-options'>
            <ul className='nav-list'>
                <li><Link to="/shop/earrings">EARRINGS</Link></li>
                <li><Link to="/shop/necklaces">NECKLACES</Link></li>
                <li><Link to="/shop/desk-buddy">DESK BUDDY</Link></li>
                <li><Link to="/shop/polymer-clay-charms">POLYMER CLAY CHARMS</Link></li>
                <li><Link to="/shop/resin-charms-keychain">RESIN CHARMS/KEYCHAIN</Link></li>
            </ul>
        </div>
    </nav>
)

const mapStateToProps = state => ({
    sections: selectDirectorySections()
})
export default connect()(NavBar);
